import React from 'react'

const Settings = () => {
  return (
    <div className='text-center'>
      <img src="/image/settings.png" className='mt-1' style={{ padding: '10px', height: '9em', filter: 'drop-shadow(2px 3px 10px)' }} alt="" />
    </div>
  )
}

export default Settings
